c8065f59-b5b0-4066-8d12-4a39eb2bb1a9.source:
// 创建物体
var name_list=["Object_324","Object_302","Object_280"];
var len=name_list.length;
var obj_list=[]
for(var i=0;i<len;i++)
{
	obj_list[i]=scene.getObjectByName(name_list[i]);
}


var line_list = [];
var lineGeometry = null;
var lineMaterial = null;

// 创建连线
/*
var lineGeometry = new THREE.BufferGeometry().setFromPoints([this.position, obj_1.position]);
var lineMaterial = new THREE.LineBasicMaterial({ color: 0xff0000,linewidth:4 });
var line_1 = new THREE.Line(lineGeometry, lineMaterial);

var lineGeometry = new THREE.BufferGeometry().setFromPoints([this.position, obj_2.position]);
var lineMaterial = new THREE.LineBasicMaterial({ color: 0xff0000,linewidth:4 });
var line_2 = new THREE.Line(lineGeometry, lineMaterial);
*/

for(var i=0;i<len;i++)
{
	lineGeometry = new THREE.BufferGeometry().setFromPoints([this.position, obj_list[i].position]);
	lineMaterial = new THREE.LineBasicMaterial({ color: 0xff0000,linewidth:10 });
	line_list[i] = new THREE.Line(lineGeometry, lineMaterial);

}

function update( event ) {

	for(var i=0;i<len;i++)
	{
		scene.add(line_list[i]);
		line_list[i].geometry.setFromPoints([this.position, obj_list[i].position]);
	}



	// 渲染场景
	renderer.render(scene, camera);

}

