/*
// 初始视角的欧拉角
const initialRotation = {
  x: 0,
  y: 0,
  z: 0
};


var  rotationSpeed = 0.015; 


document.addEventListener('keydown', onKeyDown);
// 键盘按下事件处理函数
function onKeyDown(event) {
  // 旋转速度

  switch (event.keyCode) {
    case 37: // 左箭头键
      rotationSpeed -= 0.005;
      break;
    case 39: // 右箭头键
      rotationSpeed += 0.005;
      break;
    case 38: // 上箭头键
      //scene.rotation.x += 0.005;
      break;
    case 40: // 下箭头键
      //scene.rotation.x -= 0.005;
      break;
	case 82:
	  // 重置场景的旋转角度为初始值
      scene.rotation.set(initialRotation.x, initialRotation.y, initialRotation.z);
	  rotationSpeed=0.005;
	  break;			 
    default:
      break;
  }
}




// 初始化变量
let isDragging = false;
let previousMousePosition = {
  x: 0,
  y: 0
};

// 监听鼠标按下事件
document.addEventListener('mousedown', onMouseDown);

// 监听鼠标移动事件
document.addEventListener('mousemove', onMouseMove);

// 监听鼠标释放事件
document.addEventListener('mouseup', onMouseUp);

// 鼠标按下事件处理函数
function onMouseDown(event) {
  isDragging = true;
  previousMousePosition = {
    x: event.clientX,
    y: event.clientY
  };
}

// 鼠标移动事件处理函数
function onMouseMove(event) {
  if (isDragging) {
    const deltaMove = {
      x: event.clientX - previousMousePosition.x,
      y: event.clientY - previousMousePosition.y
    };

    const deltaRotationQuaternion = new THREE.Quaternion()
      .setFromEuler(new THREE.Euler(
        toRadians(deltaMove.y * 1)/10,
        toRadians(deltaMove.x * 1)/10,
        0,
        'XYZ'
      ));
	scene.quaternion.multiplyQuaternions(deltaRotationQuaternion, scene.quaternion);

    previousMousePosition = {
      x: event.clientX,
      y: event.clientY
    };
  }
}

// 鼠标释放事件处理函数
function onMouseUp() {
  isDragging = false;
}

// 辅助函数，将角度转换为弧度
function toRadians(angle) {
  return angle * (Math.PI / 180);
}


window.addEventListener('wheel', onMouseWheel);

// Function to handle mouse wheel event
function onMouseWheel(event) {
  // Adjust camera position or field of view based on scroll wheel delta
  var delta = event.deltaY;

  // Example: Adjust camera position
  //camera.position.z += delta * 0.1; // Increase or decrease camera's z position

  // Example: Adjust camera field of view
  camera.fov += delta * 0.05; // Increase or decrease camera's field of view
  camera.updateProjectionMatrix(); // Update camera's projection matrix

  // Render the scene with updated camera
  render();
}


function update( event ) {


	// 创建网格辅助对象
	const gridHelper = new THREE.GridHelper(30, 30); // 第一个参数是网格的尺寸，第二个参数是网格的分割数

	// 将网格添加到场景中
	scene.add(gridHelper);

	// 根据需要更新场景的旋转角度
  	if(!isDragging)
	{
		scene.rotation.y += rotationSpeed; // 旋转角度为每帧增加0.01弧度
	}

	// 渲染场景
	renderer.render(scene, camera);
}
*/

